// Offers.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OffersTable = () => {
  const [offers, setOffers] = useState([]); // wszystkie oferty
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const pageSize = 10; // liczba ofert na stronę

  useEffect(() => {
    const fetchAllOffers = async () => {
      setLoading(true);
      try {
        let currentPage = 1;
        let allOffers = [];
        let totalOffersCount = 0;
        let hasMore = true;

        // Pętla, która pobiera kolejne strony, dopóki nie osiągniemy liczby określonej w meta.all
        while (hasMore) {
          console.log(`Fetching page ${currentPage}`);
          const response = await axios.get(
            'https://api-lockstep.berlin-opiekunki.pl/v1/offer/all',
            { params: { page: currentPage, pageSize } }
          );
          console.log(`Response for page ${currentPage}:`, response.data);

          // Przy pierwszym zapytaniu pobieramy łączną liczbę ofert
          if (currentPage === 1) {
            totalOffersCount = response.data.meta.all;
            console.log(`Total offers count (meta.all): ${totalOffersCount}`);
          }

          const pageOffers = response.data.offers || [];
          console.log(`Number of offers on page ${currentPage}: ${pageOffers.length}`);
          allOffers = allOffers.concat(pageOffers);

          // Jeżeli pobraliśmy mniej niż pageSize lub osiągnęliśmy łączną liczbę ofert, kończymy pętlę
          if (pageOffers.length < pageSize || allOffers.length >= totalOffersCount) {
            hasMore = false;
          } else {
            currentPage++;
          }
        }

        console.log('All offers before deduplication:', allOffers);

        // Usuwamy duplikaty na podstawie pola uid (lub id, jeśli uid nie istnieje)
        const uniqueOffers = [
          ...new Map(allOffers.map(offer => [offer.uid || offer.id, offer])).values()
        ];
        console.log('Offers after deduplication:', uniqueOffers);

        // Przycinamy wyniki do totalOffersCount (np. 21)
        const trimmedOffers = uniqueOffers.slice(0, totalOffersCount);
        console.log('Offers after trimming:', trimmedOffers);

        // Sortujemy oferty według daty rozpoczęcia (rosnąco)
        const sortedOffers = trimmedOffers.sort(
          (a, b) => new Date(a.startDate) - new Date(b.startDate)
        );
        setOffers(sortedOffers);
      } catch (err) {
        console.error('Błąd pobierania ofert:', err);
        setError('Błąd pobierania ofert');
      } finally {
        setLoading(false);
      }
    };

    fetchAllOffers();
  }, []);

  if (loading) return <div>Ładowanie ofert...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h2 style={{ textAlign: 'center' }}>Oferty Pracy</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse', marginTop: '20px' }}>
        <thead>
          <tr style={{ backgroundColor: '#f4f4f4' }}>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>UID</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Tytuł</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Opis</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Miasto</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Kod</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Płeć</th>
            <th style={{ border: '1px solid #ddd', padding: '12px', textAlign: 'left' }}>Data rozpoczęcia</th>
          </tr>
        </thead>
        <tbody>
          {offers.map((offer, index) => (
            <tr key={offer.uid || offer.id || index}>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.uid || offer.id}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.title}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.description}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.city}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.code}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>{offer.sex}</td>
              <td style={{ border: '1px solid #ddd', padding: '12px' }}>
                {offer.startDate ? new Date(offer.startDate).toLocaleString() : 'Brak daty'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OffersTable;
